import { useState, useEffect } from 'react';

export default function WatchParallax() {
  const [scrollPosition, setScrollPosition] = useState(0);

  // Handle scroll event to update parallax effect
  useEffect(() => {
    const handleScroll = () => {
      const position = window.pageYOffset;
      setScrollPosition(position);
    };

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  return (
    <div className="relative w-full">
      {/* Parallax Background */}
      <div 
        className="relative h-screen w-full overflow-hidden bg-black"
      >
        {/* Watch image with parallax effect */}
        <div 
          className="absolute inset-0 bg-cover bg-center"
          style={{
            backgroundImage: `url('/api/placeholder/1200/800')`,
            transform: `translateY(${scrollPosition * 0.3}px)`,
            opacity: 0.7
          }}
          aria-hidden="true"
        />

        {/* Darkened overlay */}
        <div className="absolute inset-0 bg-black bg-opacity-50"></div>

        {/* Content Container */}
        <div className="absolute inset-0 flex flex-col items-center justify-center text-center px-4">
          {/* Main Title with Gold Accent */}
          <h1 className="text-4xl md:text-6xl font-serif font-bold text-white mb-4">
            <span className="block">LE MONDE DES</span>
            <span className="block text-yellow-400">MONTRES</span>
          </h1>

          {/* Subtitle */}
          <p className="text-lg md:text-xl text-gray-200 mb-8 font-light tracking-wide">
            Discover the Universe of Exclusive Timepieces
          </p>

          {/* CTA Button */}
          <button className="px-8 py-3 border-2 border-yellow-400 text-yellow-400 hover:bg-yellow-400 hover:text-black transition duration-300 uppercase tracking-wider font-medium">
            Explore Collection
          </button>
        </div>
      </div>

      {/* Feature Highlights Section */}
      <div className="bg-white py-16">
        <div className="max-w-6xl mx-auto px-4 grid grid-cols-1 md:grid-cols-4 gap-10 text-center">
          <div className="flex flex-col items-center">
            <div className="text-gray-700 mb-4">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-10 w-10" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M16 11V7a4 4 0 00-8 0v4M5 9h14l1 12H4L5 9z" />
              </svg>
            </div>
            <h3 className="font-medium text-lg mb-2">Free Shipping</h3>
            <p className="text-gray-600 text-sm">On all orders over $300</p>
          </div>

          <div className="flex flex-col items-center">
            <div className="text-gray-700 mb-4">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-10 w-10" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M4 4v5h.582m15.356 2A8.001 8.001 0 004.582 9m0 0H9m11 11v-5h-.581m0 0a8.003 8.003 0 01-15.357-2m15.357 2H15" />
              </svg>
            </div>
            <h3 className="font-medium text-lg mb-2">Easy Returns</h3>
            <p className="text-gray-600 text-sm">Return policy of 30 days</p>
          </div>

          <div className="flex flex-col items-center">
            <div className="text-gray-700 mb-4">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-10 w-10" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M12 6V4m0 2a2 2 0 100 4m0-4a2 2 0 110 4m-6 8a2 2 0 100-4m0 4a2 2 0 110-4m0 4v2m0-6V4m6 6v10m6-2a2 2 0 100-4m0 4a2 2 0 110-4m0 4v2m0-6V4" />
              </svg>
            </div>
            <h3 className="font-medium text-lg mb-2">Customizable</h3>
            <p className="text-gray-600 text-sm">Add your favorite features</p>
          </div>

          <div className="flex flex-col items-center">
            <div className="text-gray-700 mb-4">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-10 w-10" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z" />
              </svg>
            </div>
            <h3 className="font-medium text-lg mb-2">24/7 Support</h3>
            <p className="text-gray-600 text-sm">Dedicated to help you</p>
          </div>
        </div>
      </div>
    </div>
  );
}
